INSERT INTO rooms_room VALUES(1,'Pokoj 101',replace(replace('Příjemně zařízený dvoulůžkový apartmán v přízemí apartmánového domu v klidné lázeňské čtvrti Karových Varů. Apartmán se nachází jen pět minut chůze od Vřídla, Mlýnské kolonády, restaurací, mnoha památek, např: kostela sv. Máří Magdalény, městského divadla apod.\r\nApartmán tvoří pokoj s manželskou postelí. Pokoj je dále vybaven jídelním stolem se židlemi, skříněmi, odkládacími stolky, plochou TV s připojením k internetu, s možností sledování Netflix, Youtube, Google TV a jiné. WIFI je v celém objektu zdarma.\r\n\r\nSoučástí apartmánu je kuchyně s plně vybavenou kuchyňskou linkou, el. varnou deskou, chladničkou s mrazákem, myčkou na nádobí, troubou, rychlovarnou konvicí, mikrovlnnou troubou a kompletním vybavením kuchyně pro vaření.\r\n\r\nApartmán nabízí koupelnu se sprchovým koutem a WC, k dispozici jsou ručníky a koupelnová drogerie.\r\n\r\nSoučástí je prostorná terasa, která v letním období láká k posezení.\r\n\r\nDětská postýlka za poplatek na vyžádání.\r\n\r\nPobyt s domácími mazlíčky možný za poplatek.','\r',char(13)),'\n',char(10)),2,'room_images/P1257605.jpg');
INSERT INTO rooms_room VALUES(2,'Pokoj 102',replace(replace('Příjemně zařízený dvoulůžkový apartmán v přízemí apartmánového domu v klidné lázeňské čtvrti Karových Varů. Apartmán se nachází jen pět minut chůze od Vřídla, Mlýnské kolonády, mnoha restaurací a kulturních památek např. kostel sv. Máří Magdalény, městské divadlo a další.\r\nApartmán tvoří pokoj s manželskou postelí. Pokoj je dále vybaven jídelním stolem se židlemi, skříněmi, odkládacími stolky, plochou TV s připojením k internetu, s možností sledování Netflix, Youtube, Google TV a jiné. WIFI zdarma.\r\n\r\nSoučástí apartmánu je plně vybavený kuchyňský kout, el. varnou deskou, chladničkou s mrazákem, myčkou na nádobí, troubou, rychlovarnou konvicí, mikrovlnnou troubou a kompletním vybavením kuchyně pro vaření.\r\n\r\nApartmán nabízí koupelnu se sprchovým koutem a samostatným WC, k dispozici jsou ručníky a koupelnová drogerie..\r\n\r\nSoučástí je prostorná terasa, která v letním období láká k posezení.\r\n\r\nDětská postýlka za poplatek na vyžádání.\r\n\r\nPobyt s domácími mazlíčky možný za poplatek.','\r',char(13)),'\n',char(10)),2,'room_images/P1257674.jpg');
INSERT INTO rooms_room VALUES(3,'Pokoj 201',replace(replace('Příjemně zařízený dvoupokojový čtyřlůžkový apartmán v prvním patře apartmánového domu v klidné lázeňské čtvrti Karových Varů. Apartmán se nachází jen pět minut chůze od Vřídla, Mlýnské kolonády, mnoha restaurací a kulturních památek, např: kostel sv. Máří Magdalény, městské divadlo a další.\r\nApartmán tvoří pokoj s manželskou postelí s pohodlným posezením křesel s odkládacím stolkem a pokoj se dvěma jednolůžkovými postelemi. Každý s pokojů je vybaven skříněmi, odkládacími stolky, Plochou TV s připojením k internetu v obou pokojích, možnost sledování Netflix, Youtube, Google TV a jiné. WIFI zdarma.\r\n\r\nSoučástí apartmánu je kuchyně s plně vybavenou kuchyňskou linkou, el. varnou deskou, chladničkou s mrazákem, myčkou na nádobí, troubou, rychlovarnou konvicí, mikrovlnnou troubou a kompletním vybavením kuchyně pro vaření. Součástí kuchyně je větší stůl a židle.\r\n\r\nApartmán nabízí koupelnu se sprchovým koutem a WC, k dispozici jsou ručníky a koupelnová drogerie.\r\n\r\nSoučástí je prostorná terasa s přístupem z kuchyně, která v letním období láká k posezení.\r\n\r\nDětská postýlka za poplatek na vyžádání.\r\n\r\nPobyt s domácími mazlíčky možný za poplatek.','\r',char(13)),'\n',char(10)),4,'room_images/P1257312.jpg');
