INSERT INTO rooms_room VALUES(7,'Pokoj 401',replace(replace('Útulně zařízený čtyřlůžkový mezonetový apartmán ve třetím patře apartmánového domu v klidné lázeňské čtvrti Karlových Varů. Jen pět minut od Vřídla a kostele sv. Máří Magdalény.\r\nDvě dvoulůžkové postele s odkládacími stolky, plochá TV s připojením k internetu. Možnost sledování Netflix, Youtube, Google TV a další. WIFI zdarma. Prostorná koupelna s vanou a WC. K dispozici ručníky. Plně vybavená kuchyňská linka včetně nádobí, hrnců, příborů, trouby, mikrovlnné trouby, varné desky, rychlovarné konvice, myčky nádobí a chladničky s mrazákem. Bytelný jídelní stůl se čtyřmi židlemi. Dechberoucí výhled na Karlovy Vary ze všech stran.\r\n\r\nNa vyžádání dětská postýlka.\r\n\r\nPobyt s domácími mazlíčky možný za poplatek.\r\n\r\nPřístup do horního patra mezonetu po dřevěném schodišti, které nedoporučujeme pro osoby s omezenou hybností nebo tělesným postižením.','\r',char(13)),'\n',char(10)),4,'room_images/P1257495_2.jpg');
INSERT INTO rooms_room VALUES(8,'Pokoj 402',replace(replace('Útulně zařízený čtyřlůžkový mezonetový apartmán ve třetím patře apartmánového domu v klidné lázeňské čtvrti Karlových Varů. Jen pět minut od Vřídla a kostele sv. Máří Magdalény.\r\nDvě dvoulůžkové postele s odkládacími stolky, plochá TV s připojením k internetu. Možnost sledování Netflix, Youtube, Google TV a další. WIFI zdarma. Prostorná koupelna s vanou a WC. K dispozici ručníky. Plně vybavená kuchyňská linka včetně nádobí, hrnců, příborů, trouby, mikrovlnné trouby, varné desky, rychlovarné konvice, myčky nádobí a chladničky s mrazákem. Bytelný jídelní stůl se čtyřmi židlemi. Dechberoucí výhled na Karlovy Vary ze všech stran.\r\n\r\nNa vyžádání dětská postýlka.\r\n\r\nPobyt s domácími mazlíčky možný za poplatek.\r\n\r\nPřístup do horního patra mezonetu po dřevěném schodišti, které nedoporučujeme pro osoby s omezenou hybností nebo tělesným postižením.','\r',char(13)),'\n',char(10)),4,'room_images/P1257389_1.jpg');
